%POSE3DSOLVER_KNOWN_AXIS_AM Refractive pose minimal solver, known rotation axis case
%	[cos(theta) sin(theta) tx ty tz] = POSE3DSOLVER_KNOWN_AXIS_AM(X,x,N,d,n1,n2) solves for one rotation
%	angle and the translation parameters of a camera observing points X projected to x.
%	The coordinate system is assumed to have been transformed so that the unknown rotation axis
%	is aligned with the y-axis.
%	n1 and n2 are the refractive indices of the camera- and point-side media respectively.
%
%	N = POSE3DSOLVER_KNOWN_AXIS_AM(...,'newton',k) refines the solutions with k Newton steps.
%
%	N = POSE3DSOLVER_KNOWN_AXIS_AM(...,'check_tol',tol) filters solutions with absolute tolerance tol.
function v = pose3dsolver_known_axis_am(X,x,N,d,n1,n2,varargin)

newton_steps = 0;
check_tol = 1e-3;

for i=1:2:length(varargin)
	switch varargin{i}
		case 'newton', newton_steps = varargin{i+1};
		case 'check_tol', check_tol = varargin{i+1};
		otherwise, error('Parameter parse error');
	end
end

x = [x(1:2,:); ones(1,size(x,2))];
u = bsxfun(@rdivide,x,sqrt(sum(x.^2,1)));
nrat2 = (n1/n2)^2;

% Fill in equation matrix
coeff = eqcoeff(u,X,N,d,nrat2);
C = eqmat(coeff);


dE = 3259;
dR = 44;
dB = 62;
red_ia = [1:38 43 45 46 48 52 57];
red_ib = 1:44;
basis_ia = [39 40 41 42 44 47 49 50 51 53 54 55 56 58 59 60 61 62];
basis_ib = [2 4 7 11 16 18 21 23 26 29 31 34 38 43 45 48 52 57];

% Eliminate excessive monomials and solve for reduction monomials
[qc,r,~] = qr(C(:,1:dE),C(:,dE+1:end),0);
C2 = [r qc];

% red = find(abs(C2(:,dE))>1e-12,1,'last')+1:size(C2,1);
% red = find(all(abs(C2(:,1:dE))<1e-12,2));
red = find(abs(diag(C2))>1e-12,1,'last')+1:size(C2,1);
CR2 = C2(red,dE+1:dE+dR);
CB2 = C2(red,dE+dR+1:end);
T = -(CR2\CB2);

% Construct action matrix
A = zeros(dB);
for r=1:length(red_ia)
	A(red_ia(r),:) = T(red_ib(r),:);
end
for r=1:length(basis_ia)
	A(basis_ia(r),basis_ib(r)) = 1;
end

[v,~] = eig(A);

% v = [c s tx ty tz]
v = bsxfun(@rdivide,v(end-5:end-1,:),v(end,:)); % Divide by constant term

% Throw away obviously complex solutions
v = real(v(:,max(abs(imag(v)))<1e-4));

% Check in the equations
keep = true(1,size(v,2));
for i=1:size(v,2)
	if max(abs(solvedeq(u,X,N,d,nrat2,v(:,i))))>1e-2
		keep(i) = false;
	end
end
v = v(:,keep);


% Take a few Newton steps to refine solutions
if newton_steps
	for i=1:size(v,2)
		for j=1:newton_steps
			[f J] = eqjacandfun(u,X,N,d,nrat2,v(:,i));
			v(:,i) = v(:,i) - J\f;
		end
	end
end

% Check in the equations again
keep = true(1,size(v,2));
for i=1:size(v,2)
	if max(abs(solvedeq(u,X,N,d,nrat2,v(:,i))))>check_tol
		keep(i) = false;
	end
end
v = v(:,keep);




